from typing import List
class Solution:
    def findMaxLength_slow(self, nums: List[int]) -> int:
        counter0=[0]*(len(nums)+1)
        for i in range(0,len(nums)):
            if nums[i]==0:
                counter0[i+1]=counter0[i]+1
            elif nums[i]==1:
                counter0[i+1]=counter0[i]
        max_len=0
        for start in range(0,len(nums)-max_len):
            print(start)
            for end in range(start+max_len-1,len(nums)):
                if (end-start+1)%2==1:
                    continue
                else:
                    num0=counter0[end+1]-counter0[start]
                    if num0==(end-start+1)//2:
                        max_len=max(max_len,end-start+1)
        return max_len

    def findMaxLength(self, nums):
        count = 0  #number of 1-number of 0
        max_length = 0
        table = {0: 0} #the first time a count appears
        for index, num in enumerate(nums, 1):
            if num == 0:
                count -= 1
            else:
                count += 1
            if count in table:
                max_length = max(max_length, index - table[count])
            else:
                table[count] = index
        return max_length
